searchIndex["decimal"] = {"doc":"","items":[[3,"d128","decimal","A 128-bit decimal floating point type.",null,null],[3,"Status","","The status of the floating point context. Instead of faulting after every operation errors\nare added to this status. User code can check and/or clear the status fully or partially at\nspecific points to check the validity of the computation. Each thread gets its own status.\nThe status is initially empty.",null,null],[4,"Rounding","","",null,null],[13,"Ceiling","","",0,null],[13,"Up","","",0,null],[13,"HalfUp","","",0,null],[13,"HalfEven","","Round to nearest; if equidistant, round so that the final digit is even.\nThis is the only rounding mode supported.",0,null],[13,"HalfDown","","",0,null],[13,"Down","","",0,null],[13,"Floor","","",0,null],[13,"ZeroOrFiveUp","","",0,null],[4,"Class","","",null,null],[13,"Snan","","",1,null],[13,"Qnan","","",1,null],[13,"NegInf","","",1,null],[13,"NegNormal","","",1,null],[13,"NegSubnormal","","",1,null],[13,"NegZero","","",1,null],[13,"PosZero","","",1,null],[13,"PosSubnormal","","",1,null],[13,"PosNormal","","",1,null],[13,"PosInf","","",1,null],[11,"clone","","",2,null],[11,"is_outside_order","","",2,null],[11,"into","","",2,null],[11,"decode","","",2,{"inputs":[{"name":"d"}],"output":{"name":"result"}}],[11,"encode","","",2,null],[11,"hash","","",2,null],[11,"serialize","","",2,null],[11,"deserialize","","",2,{"inputs":[{"name":"d"}],"output":{"name":"result"}}],[11,"from","","",2,{"inputs":[{"name":"i32"}],"output":{"name":"d128"}}],[11,"from","","",2,{"inputs":[{"name":"u32"}],"output":{"name":"d128"}}],[11,"as_ref","","",2,null],[11,"from_str","","",2,{"inputs":[{"name":"str"}],"output":{"name":"result"}}],[11,"into","","",2,null],[11,"into","","",2,null],[11,"fmt","","",2,null],[11,"fmt","","",2,null],[11,"fmt","","",2,null],[11,"fmt","","",2,null],[11,"eq","","",2,null],[11,"partial_cmp","","",2,null],[11,"add","","",2,null],[11,"add","","",2,null],[11,"sub","","",2,null],[11,"sub","","",2,null],[11,"mul","","",2,null],[11,"mul","","",2,null],[11,"div","","",2,null],[11,"div","","",2,null],[11,"bitand","","",2,null],[11,"bitand","","",2,null],[11,"bitor","","",2,null],[11,"bitor","","",2,null],[11,"bitxor","","",2,null],[11,"bitxor","","",2,null],[11,"rem","","",2,null],[11,"rem","","",2,null],[11,"add_assign","","",2,null],[11,"sub_assign","","",2,null],[11,"mul_assign","","",2,null],[11,"div_assign","","",2,null],[11,"bitand_assign","","",2,null],[11,"bitor_assign","","",2,null],[11,"bitxor_assign","","",2,null],[11,"rem_assign","","",2,null],[11,"neg","","",2,null],[11,"not","","",2,null],[11,"shl","","",2,null],[11,"shl_assign","","",2,null],[11,"shr","","",2,null],[11,"shr_assign","","",2,null],[11,"from_raw_bytes","","Creates a d128 from raw bytes. Endianess is host dependent.",2,null],[11,"to_raw_bytes","","Returns raw bytes for this d128. Endianess is host dependent.",2,null],[11,"get_status","","Returns the thread local status.",2,{"inputs":[],"output":{"name":"status"}}],[11,"set_status","","Sets the thread local status.",2,{"inputs":[{"name":"status"}],"output":null}],[11,"from_hex","","Reads the hex binary representation from a string. This is the reverse of formatting with\n{:x}.",2,{"inputs":[{"name":"str"}],"output":{"name":"d128"}}],[11,"zero","","Returns the d128 representing +0.",2,{"inputs":[],"output":{"name":"d128"}}],[11,"abs","","Returns the absolute value of `self`.",2,null],[11,"mul_add","","Calculates the fused multiply-add `self` × `a` + `b` and returns the result. The multiply\nis carried out first and is exact, so this operation has only the one, final, rounding.",2,null],[11,"logb","","Returns the adjusted exponent of `self`, according to IEEE 754 rules. That is, the exponent\nreturned is calculated as if the decimal point followed the first significant digit (so,\nfor example, if `self` were 123 then the result would be 2). If `self` is infinite, the\nresult is +Infinity. If `self` is a zero, the result is –Infinity, and the\n`DIVISION_BY_ZERO` flag is set. If `self` is less than zero, the absolute value of `self`\nis used. If `self` is 1, the result is 0. NaNs are handled (propagated) as for arithmetic\noperations.",2,null],[11,"max","","If both `self` and `other` are numeric (not NaNs) this returns the larger of the two\n(compared using total ordering, to give a well-defined result). If either (but not both of)\nis a quiet NaN then the other argument is the result; otherwise NaNs are handled as for\narithmetic operations.",2,null],[11,"min","","If both `self` and `other`  are numeric (not NaNs) this returns the smaller of the two\n(compared using total ordering, to give a well-defined result). If either (but not both of)\nis a quiet NaN then the other argument is the result; otherwise NaNs are handled as for\narithmetic operations.",2,null],[11,"next","","Returns the ‘next’ d128 to `self` in the direction of +Infinity according to IEEE 754 rules\nfor nextUp. The only status possible is `INVALID_OPERATION` (from an sNaN).",2,null],[11,"previous","","Returns the ‘next’ d128 to `self` in the direction of –Infinity according to IEEE 754 rules\nfor nextDown. The only status possible is `INVALID_OPERATION` (from an sNaN).",2,null],[11,"pow","","The number is set to the result of raising `self` to the power of `exp`. Results will be\nexact when `exp` has an integral value and the result does not need to be rounded, and also\nwill be exact in certain special cases, such as when `self` is a zero (see the arithmetic\nspecification for details). Inexact results will always be full precision, and will almost\nalways be correctly rounded, but may be up to 1 _ulp_ (unit in last place) in error in rare\ncases. This is a mathematical function; the 10&lt;sup&gt;6&lt;/sup&gt; restrictions on precision and\nrange apply as described above, except that the normal range of values is allowed if `exp`\nhas an integral value in the range –1999999997 through +999999999.",2,null],[11,"exp","","The number is set to _e_ raised to the power of `exp`. Finite results will always be full\nprecision and inexact, except when `exp` is a zero or –Infinity (giving 1 or 0\nrespectively). Inexact results will almost always be correctly rounded, but may be up to 1\nulp (unit in last place) in error in rare cases. This is a mathematical function; the\n10&lt;sup&gt;6&lt;/sup&gt; restrictions on precision and range apply as described above.",2,null],[11,"ln","","The number is set to the natural logarithm (logarithm in base e) of `self`. `self` must be\npositive or a zero. Finite results will always be full precision and inexact, except when\n`self` is equal to 1, which gives an exact result of 0. Inexact results will almost always\nbe correctly rounded, but may be up to 1 ulp (unit in last place) in error in rare cases.\nThis is a mathematical function; the 10&lt;sup&gt;6&lt;/sup&gt; restrictions on precision and range\napply as described above.",2,null],[11,"log10","","The number is set to the logarithm in base ten of `self`. `self` must be positive or a\nzero. Finite results will always be full precision and inexact, except when `self` is equal\nto an integral power of ten, in which case the result is the exact integer. Inexact results\nwill almost always be correctly rounded, but may be up to 1 ulp (unit in last place) in\nerror in rare cases. This is a mathematical function; the 10&lt;sup&gt;6&lt;/sup&gt; restrictions on\nprecision and range apply as described above.",2,null],[11,"towards","","Returns the ‘next’ d128 to `self` in the direction of `other` according to proposed IEEE\n754  rules for nextAfter.  If `self` == `other` the result is `self`. If either operand is\na NaN the result is as for arithmetic operations. Otherwise (the operands are numeric and\ndifferent) the result of adding (or subtracting) an infinitesimal positive amount to `self`\nand rounding towards +Infinity (or –Infinity) is returned, depending on whether `other` is\nlarger  (or smaller) than `self`. The addition will set flags, except that if the result is\nnormal  (finite, non-zero, and not subnormal) no flags are set.",2,null],[11,"quantize","","Returns `self` set to have the same quantum as `other`, if possible (that is, numerically\nthe same value but rounded or padded if necessary to have the same exponent as `other`, for\nexample to round a monetary quantity to cents).",2,null],[11,"reduce","","Returns a copy of `self` with its coefficient reduced to its shortest possible form without\nchanging the value of the result. This removes all possible trailing zeros from the\ncoefficient (some may remain when the number is very close to the most positive or most\nnegative number). Infinities and NaNs are unchanged and no status is set unless `self` is\nan sNaN. If `self` is a zero the result exponent is 0.",2,null],[11,"rotate","","The result is a copy of `self` with the digits of the coefficient rotated to the left (if\n`amount` is positive) or to the right (if `amount` is negative) without adjusting the\nexponent or the sign of `self`. `amount` is the count of positions to rotate and must be a\nfinite integer (with exponent=0) in the range -34 through +34. NaNs are propagated as\nusual. If `self` is infinite the result is Infinity of the same sign. No status is set\nunless `amount` is invalid or an operand is an sNaN.",2,null],[11,"scaleb","","This calculates `self` × 10&lt;sup&gt;`other`&lt;/sup&gt; and returns the result. `other` must be an\ninteger (finite with exponent=0) in the range ±2 × (34 + 6144), typically resulting from\n`logb`. Underflow and overflow might occur. NaNs propagate as usual.",2,null],[11,"compare","","Compares `self` and `other` numerically and returns the result. The result may be –1, 0, 1,\nor NaN (unordered); –1 indicates that `self` is less than `other`, 0 indicates that they\nare numerically equal, and 1 indicates that `self` is greater than `other`. NaN is returned\nonly if `self` or `other` is a NaN.",2,null],[11,"compare_total","","Compares `self` and `other` using the IEEE 754 total ordering (which takes into account the\nexponent) and returns the result. No status is set (a signaling NaN is ordered between\nInfinity and NaN). The result will be –1, 0, or 1.",2,null],[11,"canonical","","Returns `self` ensuring that the encoding is canonical.",2,null],[11,"class","","Returns the class of `self`.",2,null],[11,"classify","","Same as `class()` but returns `std::num::FpCategory`.",2,null],[11,"digits","","Returns the number of significant digits in `self`. If `self` is a zero or is infinite, 1\nis returned. If `self` is a NaN then the number of digits in the payload is returned.",2,null],[11,"is_canonical","","Returns `true` if the encoding of `self` is canonical, or `false` otherwise.",2,null],[11,"is_finite","","Returns `true` if `self` is neither infinite nor a NaN, or `false` otherwise.",2,null],[11,"is_integer","","Returns `true` if `self` is finite and its exponent is zero, or `false` otherwise.",2,null],[11,"is_logical","","Returns `true` if `self`  is a valid argument for logical operations (that is, `self` is\nzero or positive, an integer (finite with a zero exponent) and comprises only zeros and/or\nones), or `false` otherwise.",2,null],[11,"is_infinite","","Returns `true` if the encoding of `self` is an infinity, or `false` otherwise.",2,null],[11,"is_nan","","Returns `true` if `self` is a NaN (quiet or signaling), or `false` otherwise.",2,null],[11,"is_negative","","Returns `true` if `self` is less than zero and not a NaN, or `false` otherwise.",2,null],[11,"is_normal","","Returns `true` if `self` is a normal number (that is, is finite, non-zero, and not\nsubnormal), or `false` otherwise.",2,null],[11,"is_positive","","Returns `true` if `self` is greater than zero and not a NaN, or `false` otherwise.",2,null],[11,"is_signaling","","Returns `true` if `self` is a signaling NaN, or `false` otherwise.",2,null],[11,"is_signed","","Returns `true` if `self` has a minus sign, or `false` otherwise. Note that zeros and NaNs\nmay have a minus sign.",2,null],[11,"is_subnormal","","Returns `true` if `self` is subnormal (that is, finite, non-zero, and with magnitude less\nthan 10&lt;sup&gt;-6143&lt;/sup&gt;), or `false` otherwise.",2,null],[11,"is_zero","","Returns `true` if `self` is zero, or `false` otherwise.",2,null],[17,"CONVERSION_SYNTAX","","Conversion syntax error.",null,null],[17,"DIVISION_BY_ZERO","","Division by zero.",null,null],[17,"DIVISION_IMPOSSIBLE","","Division impossible.",null,null],[17,"DIVISION_UNDEFINED","","Division undefined.",null,null],[17,"INEXACT","","The result is inexact.",null,null],[17,"INVALID_OPERATION","","An invalid operation was requested.",null,null],[17,"OVERFLOW","","Overflow.",null,null],[17,"UNDERFLOW","","Underflow.",null,null],[11,"clone","","",0,null],[11,"fmt","","",0,null],[11,"eq","","",0,null],[11,"clone","","",1,null],[11,"fmt","","",1,null],[11,"eq","","",1,null],[11,"eq","","",3,null],[11,"ne","","",3,null],[11,"clone","","",3,null],[11,"partial_cmp","","",3,null],[11,"lt","","",3,null],[11,"le","","",3,null],[11,"gt","","",3,null],[11,"ge","","",3,null],[11,"cmp","","",3,null],[11,"hash","","",3,null],[11,"fmt","","",3,null],[11,"empty","","Returns an empty set of flags.",3,{"inputs":[],"output":{"name":"status"}}],[11,"all","","Returns the set containing all flags.",3,{"inputs":[],"output":{"name":"status"}}],[11,"bits","","Returns the raw value of the flags currently stored.",3,null],[11,"from_bits","","Convert from underlying bit representation, unless that\nrepresentation contains bits that do not correspond to a flag.",3,{"inputs":[{"name":"uint32_t"}],"output":{"name":"option"}}],[11,"from_bits_truncate","","Convert from underlying bit representation, dropping any bits\nthat do not correspond to flags.",3,{"inputs":[{"name":"uint32_t"}],"output":{"name":"status"}}],[11,"is_empty","","Returns `true` if no flags are currently stored.",3,null],[11,"is_all","","Returns `true` if all flags are currently set.",3,null],[11,"intersects","","Returns `true` if there are flags common to both `self` and `other`.",3,null],[11,"contains","","Returns `true` all of the flags in `other` are contained within `self`.",3,null],[11,"insert","","Inserts the specified flags in-place.",3,null],[11,"remove","","Removes the specified flags in-place.",3,null],[11,"toggle","","Toggles the specified flags in-place.",3,null],[11,"bitor","","Returns the union of the two sets of flags.",3,null],[11,"bitor_assign","","Adds the set of flags.",3,null],[11,"bitxor","","Returns the left flags, but with all the right flags toggled.",3,null],[11,"bitxor_assign","","Toggles the set of flags.",3,null],[11,"bitand","","Returns the intersection between the two sets of flags.",3,null],[11,"bitand_assign","","Disables all flags disabled in the set.",3,null],[11,"sub","","Returns the set difference of the two sets of flags.",3,null],[11,"sub_assign","","Disables all flags enabled in the set.",3,null],[11,"not","","Returns the complement of this set of flags.",3,null],[11,"extend","","",3,null],[11,"from_iter","","",3,{"inputs":[{"name":"t"}],"output":{"name":"status"}}],[14,"d128","","A macro to construct d128 literals.",null,null]],"paths":[[4,"Rounding"],[4,"Class"],[3,"d128"],[3,"Status"]]};
